openapi: 3.0.0
info:
  title: Moscow Camera
  version: 1.0.0
servers:
  - url: /
tags:
  - name: Настройки
  - name: Администратор
  - name: Пользователь
  - name: Промокоды
  - name: Пользователи
paths:
  /api/settings/createbd:
    get:
      tags:
        - Настройки
      summary: Создать бд
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /api/settings/updatebd:
    get:
      tags:
        - Настройки
      summary: Обновить БД
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /api/photos/unconfirmed:
    get:
      tags:
        - Администратор
      summary: Получить не подтвержденные фотографии
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /api/photos/slideshow:
    get:
      tags:
        - Администратор
      summary: Получить фото для слайдшоу
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /api/photos/confirmgroup:
    post:
      tags:
        - Администратор
      summary: Подтвердить группу фото
      requestBody:
        content:
          application/json:
            schema:
              type: object
              example:
                groupId: 1
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /api/photos/reject:
    post:
      tags:
        - Администратор
      summary: 'Отменить группу фото '
      requestBody:
        content:
          application/json:
            schema:
              type: object
              example:
                groupId: 1
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /api/photos/delete:
    post:
      tags:
        - Администратор
      summary: Удалить группу фото
      requestBody:
        content:
          application/json:
            schema:
              type: object
              example:
                groupId: 1
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /api/photos/uploadSnapshot:
    post:
      tags:
        - Пользователь
      summary: Загрузить фото
      requestBody:
        content:
          multipart/form-data:
            schema:
              type: object
              properties:
                snapshot:
                  type: string
                  example: >-
                    data:image/png;base64,
                groupId:
                  type: integer
                  example: '9'
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /api/photos/myphoto:
    get:
      tags:
        - Пользователь
      summary: Получить 3 фотографии пользователя
      parameters:
        - name: groupId
          in: query
          schema:
            type: integer
          example: '1'
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /api/photos/acceptPhoto:
    post:
      tags:
        - Пользователь
      summary: Выбрать фото для публикации
      requestBody:
        content:
          application/json:
            schema:
              type: object
              example:
                photoId: 1
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /api/promocodes/loadpromo:
    get:
      tags:
        - Промокоды
      summary: Загрузить промокоды из цсв
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /api/promocodes/getcode:
    get:
      tags:
        - Промокоды
      summary: Получить промокод
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /api/promocodes/getmycode:
    get:
      tags:
        - Промокоды
      summary: Получить  промокод по айди
      parameters:
        - name: id
          in: query
          schema:
            type: integer
          example: '1'
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /api/promocodes/getcodemsk:
    get:
      tags:
        - Промокоды
      summary: Москва получить промокод
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /api/promocodes/getmycodemsk:
    get:
      tags:
        - Промокоды
      summary: Москва получить промокод по айди
      parameters:
        - name: id
          in: query
          schema:
            type: integer
          example: '1'
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /api/users/auth:
    post:
      tags:
        - Пользователи
      summary: Авторизоваться
      requestBody:
        content:
          application/json:
            schema:
              type: object
              example:
                login: admin
                password: '123456'
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /api/users/create:
    post:
      tags:
        - Пользователи
      summary: Создать пользователя
      requestBody:
        content:
          application/json:
            schema:
              type: object
              example:
                login: admin
                password: '123456'
                name: Manager
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /api/users/drop:
    post:
      tags:
        - Пользователи
      summary: Удалить пользователя
      requestBody:
        content:
          application/json:
            schema:
              type: object
              example:
                id: 1
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}
  /api/photos/creategroup:
    post:
      tags:
        - Пользователи
      summary: Создать группу для фото
      requestBody:
        content: {}
      responses:
        '200':
          description: Successful response
          content:
            application/json: {}